import {STORE_DATA, SEARCHDATA} from './actionTypes';

const storeData = (payload) => ({
    type: STORE_DATA,
    payload: payload
})


const searchData = (payload) => ({
    type: SEARCHDATA,
    payload: payload
})

export { storeData }
